import { MoviesGrid } from "./components/MoviesGrid";
import styles from "./styles/App.module.css";
import {
    BrowserRouter as Router,
    Switch,
    Route,
    Link
} from "react-router-dom";

export function App() {
    return <div>
        <header>
            <h1 className={styles.title}>Movies</h1>
        </header>
        <main>
            <Switch>
                <Route path="/movie">Movie
                </Route>
                <Route path="/">
                    Home
                </Route>
            </Switch>
        </main>
    </div>;
}

